import { useState } from "react";


const AddCancel = props => {



    console.log("Add: ", props.enable)
    const disabled = props.enable.toString()

    return (
        <>
            <button id="add" type="button" class="btn btn-info" disabled={props.enable ? "true":"false"}>Add</button>
            <a href="#" class="btn btn-info btn-lg disabled" tabindex="-1" role="button" aria-disabled="true">Primary link</a>
            <button type="button" class="btn btn-light">Cancel</button>
        </>


    )
}

export default AddCancel;
